parts:
{
  "name": "UBX-NAV-POSLLH",
  "class_id": "0x01",
  "message_id": "0x02",
  "message_type": "periodic_polled",
  "description": "Geodetic position solution\nThis message outputs the Geodetic position in the currently selected ellipsoid. The default is the WGS84 Ellipsoid, but can be changed with the message CFG-NAVSPG-USE_USRDAT.",
  "payload_length": {
    "fixed": 28
  },
  "payload_fields": [
    {
      "byte_offset": 0,
      "name": "iTOW",
      "data_type": "U4",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See section iTOW timestamps in the integration manual for details."
    },
    {
      "byte_offset": 4,
      "name": "lon",
      "data_type": "I4",
      "scale": {
        "raw": "1e-7",
        "multiplier": 0.0000001
      },
      "unit": "deg",
      "description": "Longitude"
    },
    {
      "byte_offset": 8,
      "name": "lat",
      "data_type": "I4",
      "scale": {
        "raw": "1e-7",
        "multiplier": 0.0000001
      },
      "unit": "deg",
      "description": "Latitude"
    },
    {
      "byte_offset": 12,
      "name": "height",
      "data_type": "I4",
      "unit": "mm",
      "description": "Height above ellipsoid"
    },
    {
      "byte_offset": 16,
      "name": "hMSL",
      "data_type": "I4",
      "unit": "mm",
      "description": "Height above mean sea level"
    },
    {
      "byte_offset": 20,
      "name": "hAcc",
      "data_type": "U4",
      "unit": "mm",
      "description": "Horizontal accuracy estimate"
    },
    {
      "byte_offset": 24,
      "name": "vAcc",
      "data_type": "U4",
      "unit": "mm",
      "description": "Vertical accuracy estimate"
    }
  ]
}
